import React from "react";
import './styles/App.css';
import {BrowserRouter as Router, Route, Switch} from "react-router-dom";
import About from "./pages/About";

function App() {
    return (
        <Router>
            <Switch>
                <Route path="/about">
                    <About/>
                </Route>
            </Switch>
        </Router>
    );
};

export default App;
